import React from 'react'

class Exercise extends React.Component {
    state = {
        exercises: []
    }

    componentDidMount = () => {
        fetch("/api/exercise")
            .then(res => res.json())
            .then(exercises => this.setState({ exercises }))
    }

    render() {
        const exercises = this.state.exercises;
        return (
            <div>
                <h1>Exercises</h1>
                {exercises.map(exercise => (
                    <li key={exercise._id}>
                        <p>{exercise.name}</p>
                    </li>
                ))}
            </div>
        )
    }
}

export default Exercise
